import ReactSlider from "react-slider";

export default function Slider({data, currentValue}) {

    return (
        <ReactSlider
        className='mySlider'
        trackClassName="mySlider-track"
        thumbClassName="mySlider-thumb"
        markClassName="mySlider-mark"
        defaultValue={100}
        marks={20}
        max={200}
        min={0}
        value={currentValue}
        onChange={() => data()}
        />
    );
}
